import React from 'react';
import ReactDOM from 'react-dom';
import { languageModalContent } from './languageModalContent';
import RegionCard from './RegionCard';

function LanguageModal() {
    return ReactDOM.createPortal(
        <div className='language-modal'>
            <div className='language-left'>
                <h2>North America</h2>
                { languageModalContent.northAmerica.map(region => <RegionCard region={region} />) }
                <h2>South America</h2>
                { languageModalContent.southAmerica.map(region => <RegionCard region={region} />) }
                <h2>Middle-East</h2>
                { languageModalContent.middleEast.map(region => <RegionCard region={region} />) }
            </div>
            <div className='language-middle'>
                <h2>Asia Pacific</h2>
                { languageModalContent.asiaPacific.map(region => <RegionCard region={region} />) }
            </div>
            <div className='language-right'>
                <h2>Europe</h2>
                { languageModalContent.europe.map(region => <RegionCard region={region} />)}
            </div>
        </div>,
        document.getElementById('modal-root'));
}

export default LanguageModal;
